  null,\n\t\"notes\": \"The data are from the Census Bureau's Consolidated Federal
  Funds Reports on Federal expenditures and obligations for grants, salaries and wages,
  procurements, direct payments, direct loans, guaranteed loans, and insurance obtained
  from Federal Government agencies. ERS screens the data for each Federal program
  for accuracy at the county level and then presents the data by function and type
  of program for each county and State. See the complete data documentation for details.rnrnEach
  file contains Federal outlays by program for each county in the State. County population
  is also included so that per capita spending can be calculated. Summary of the data
  for the United States and a ZIP file for all States are also available.\",\n\t\"license_title\":
